DROP TABLE IF EXISTS pulau;
CREATE TABLE IF NOT EXISTS pulau(
	kode VARCHAR(11),
	nama VARCHAR(100),
	lat DOUBLE,
	lng DOUBLE,
	notes TEXT
);

